    const { message } = useContext(NoteContext)
    const [currentDate, setCurrentDate] = useState(new Date())


    return (
        <div style={{display: 'flex', justifyContent: 'space-evenly', flexWrap: 'wrap'}}>
            {message.map((notes, i) =>
                  <ToDo key={i} {...notes} currentDate={notes.currentDate}/> 
            )}
        </div>
    )
}


